import React from 'react';

class Input extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			value: 0,
			input: React.createRef()
		}
	}



	render() {
		return (
			<div>
				<form className="ui form" onChange={() => alert('click')}>
					<div className="field">
						<input type="text" ref={this.state.input} />
					</div>
				</form>
			</div>
		);
	}
}

export default Input;
